import React from "react";

import Inputs from "../../shared/Components/FormElements/Input";
import './NewPlace.css';

const NewPlace = props => {

  const formSubmitHandler = event => {
    event.preventDefault();
  };
    return(
        <form className="place-form" onSubmit={formSubmitHandler}>
          <Inputs id="title" inputfieldtype="input" label="Title" type="text" errorText="Please enter a valid title"/>
          <Inputs id="description" label="Description" type="text" errorText="Please enter a valid description"/>
          <Inputs id="description" label="Description" type="text" errorText="Please enter a valid description"/>
          <button type="submit">Add Place</button>
        </form>

    );
}

export default NewPlace;
